import React from 'react'
import personService from '../services/persons'


const Persons = ( {persons, newFilter} ) => {
    console.log(persons,id)
    const delperson = () => {
        personService.delete(persons.id)
    }
    
    return (
        <div>
            <table>
                <tbody>
                    {persons.map((element, index) => {
                        if (element.name.search(newFilter) !== -1) return (
                            <tr key={index}>
                                <td>{element.name}</td>
                                <td>{element.number}</td>
                                <td><button onAction={delperson}>Delete</button></td>
                            </tr>
                        )
                        else return null
                    })}
                </tbody>
            </table>
        </div>
    )
}

export { Persons }
